pragma solidity 0.8.1;
contract AddressExample {
    address public myAddress;
    
    function setAddress(address _address) public {
        myAddress = _address;
    }
    
    function getBalanceOfAccount() public view returns(uint) {
        return myAddress.balance;
    }
}

